type userRlpHandler interface {
	Decode(to *user, s *rlp.Stream) error
}

var defaultUserRlpHandler userRlpHandler

type hand1UserRlpHandler struct {}

func (h *hand1UserRlpHandler) Decode(to *user, s *rlp.Stream) error {
	var ru userRlp1
	if err := s.Decode(&ru); err != nil {
		return err
	}
	to.Id = ru.Id
	//to.Hand = ru.Hand
	to.Hand = make([]absHand, len(ru.Hand))
	sliceCopy(to.Hand, ru.Hand)
	return nil
}

func (b *user) DecodeRLP(s *rlp.Stream) error {
	return defaultUserRlpHandler.Decode(b, s)
}

func sliceCopy(to, from interface{})  {
	toV := reflect.ValueOf(to)
	fromV := reflect.ValueOf(from)
	fLen := fromV.Len()
	for i := 0; i < fLen; i++ {
		// support bothway copy
		toV.Index(i).Set(reflect.ValueOf(fromV.Index(i).Interface()))
	}
}

func BenchmarkSliceCopy(b *testing.B) {
	for i := 0; i < b.N; i++ {
		from := []absHand{ &hand1{X: 1} }
		to := make([]*hand1, len(from))
		sliceCopy(to, from)
		assert.Equal(b, uint(1), to[0].X)
	}
}

func BenchmarkGetAbsHands(b *testing.B) {
	for i := 0; i < b.N; i++ {
		from := []absHand{ &hand1{X: 1} }
		fLen := len(from)
		to := make([]*hand1, fLen)
		for j, f := range from {
			to[j] = f.(*hand1)
		}
		assert.Equal(b, uint(1), to[0].X)
	}
}

func getAbsHands(x []*hand1) []absHand {
	result := make([]absHand, len(x))
	for i, y := range x {
		result[i] = y
	}
	return result
}

