func TestMarshalRlp(t *testing.T) {
	defaultUserRlpHandler = &hand1UserRlpHandler{}
	//_, x := rlp.EncodeToBytes(&hand1{ X: 2 })
	//assert.NoError(t, x)
	//x := append([]absHand{ }, []*hand1{ {X: 1} }...)

	u := &user{
		Id: 2,
		Hand: []absHand{ &hand1{ X: 1 } },
	}
	ub, err := rlp.EncodeToBytes(u)
	assert.NoError(t, err)

	var tmpU user
	err = rlp.DecodeBytes(ub, &tmpU)
	assert.NoError(t, err)
	tmpU.Hand[0].Hit()
}

func TestBloomData(t *testing.T) {
	bloomHex := ""
	invBloomHex := ""
	bloom, err := hexutil.Decode(bloomHex)
	assert.NoError(t, err)
	invBloom, err := hexutil.Decode(invBloomHex)
	assert.NoError(t, err)

	var bloomG iblt.Graphene
	var invBloomG iblt.Graphene

	err = rlp.DecodeBytes(bloom, &bloomG)
	assert.NoError(t, err)
	err = rlp.DecodeBytes(invBloom, &invBloomG)
	assert.NoError(t, err)

	tempGraphene := iblt.NewGraphene(bloomG.InvBloomConfig(), bloomG.BloomConfig())
	alice, bob, err := tempGraphene.InvBloom().Subtract(bloomG.InvBloom(), invBloomG.InvBloom()).ListRLP()
	assert.NoError(t, err)
	fmt.Println("==========alice, bob==========",alice, bob)
}
